import React from "react";

// import { useState } from "react";
import { Enfamils } from "./enfamils";

const Products = () => {
  // const [locator, setLocator] = useState([]);

  return (
    // <div className=" h-screen flex justify-center items-center bg-yellow-300">
    //   <h1 className="text-9xt uppercase font-black">Products</h1>
    <>
      <div>
        <input type="text" placeholder="Search..." className="search" />
        <ul className="list">
          {Enfamils.map((enfamils) => (
            <li className="listitem">{enfamils.name}</li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default Products;
